import React, {useState, useEffect} from 'react';
import axios from 'axios';

export default function Memberlist() {
    const [user, setuser] = useState([]);
    useEffect(() => {
        axios.get("http://localhost:5000/users/")
        .then(response=>{
            setuser(response.data);
        })
        .catch(error=>
            {console.log(error)
            });
    })
    return (
        <div>
            <h1>Member List</h1>
            {(user.map(user=>{
                console.log(user);
            }))}
        </div>
    )
}
